import React from 'react'
import LogoNinja from '../assets/LOGO NINJA.jpg'
import TextoNinja from '../assets/TEXTO NINJA.jpeg'
import LogoUsuario from '../assets/LOGO USUARIO.png'
import '../styles/Logos.css'
function Logos() {
  return (
    <div className='Molecula2'>

        <img src={LogoNinja} alt='logo ninja'/>
        <img src={TextoNinja} alt='texto ninja'/>
        <img src={LogoUsuario} alt='Logo Usuario'/>
    </div>
  )
}

export {Logos}
